_values = client.persist(cpt)\n    #arrays.validate_contract()   \n    explained_variance , singular_values = client.compute([explained_variance ,singular_values])\n    print(\"explained_variance ,singular_values\",explained_variance.result() ,\" and \" , singular_values.result(), flush=True )\n\nprint(\"Done in \", time.time() -t , \" secondes\")\n    \nos.remove('data.h5') \nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{},"id":"1082","type":"LinearScale"},{"attributes":{"child":{"id":"1039"},"title":"Scheduler Profile (administrative)"},"id":"1405","type":"Panel"},{"attributes":{},"id":"1477","type":"AllLabels"},{"attributes":{"child":{"id":"bk-task-stream-plot"},"title":"Task Stream"},"id":"1406","type":"Panel"},{"attributes":{"axis":{"id":"1259"},"coordinates":null,"group":null,"ticker":null},"id":"1262","type":"Grid"},{"attributes":{"callback":null},"id":"1092","type":"TapTool"},{"attributes":{"child":{"id":"bk-bandwidth-worker-plot"},"title":"Bandwidth (Workers)"},"id":"1407","type":"Panel"},{"attributes":{"line_alpha":0.1,"line_color":"#1f77b4","x":{"field":"time"},"y":{"field":"num_fds"}},"id":"1395","type":"Line"},{"attributes":{},"id":"1257","type":"LinearScale"},{"attributes":{"line_alpha":0.2,"line_color":"#1f77b4","x":{"field":"time"},"y":{"field":"memory"}},"id":"1277","type":"Line"},{"attributes":{},"id":"1500","type":"UnionRenderers"},{"attributes":{},"id":"1044","type":"LinearScale"},{"attributes":{"axis":{"id":"1084"},"coordinates":null,"group":null,"ticker":null,"visible":false},"id":"1087","type":"Grid"},{"attributes":{},"id":"1501","type":"Selection"},{"attributes":{"coordinates":null,"formatter":{"id":"1438"},"group":null,"major_label_policy":{"id":"1439"},"ticker":{"id":"1085"},"visible":false},"id":"1084","type":"LinearAxis"},{"attributes":{"callback":null},"id":"1020","type":"TapTool"},{"attributes":{},"id":"1080","type":"LinearScale"},{"attributes":{},"id":"1040","type":"DataRange1d"},{"attri
